script: |
  super -f text -I q7251.spq | sort > q7251.out

inputs:
  - name: q7251.spq
    data: |
      SELECT - 24 FROM tab0 (FORMAT parquet) AS cor0 WHERE ( + 29 ) NOT IN ( + col2 + + col1 - - col0 * - - col1 * - col0 + col0, - col0 * col2 );
  - name: tab0

outputs:
  - name: q7251.out
    data: |
      -24
      -24
      -24
